frican plant. Their success hinges on the patient\n     having a \'peak\' experience, entering the realm of the mystical or\n     religious. The early researchers had spotted this. Now it was\n     dramatically reinforced by unique new evidence from Brazil.\n\n     Unable to work in the USA, Grob visited Brazil to track down the\n     ritual use of Ayahuasca, a leaf rich in the powerful DMT. For\n     centuries it has been used amongst the shamans of the Amazon. But\n     today, in urban Brazil, tens of thousands of men, women and\n     children are taking the drug as part of an ecstatic Christian cult\n     experience. The Brazillian Government asked Grob to look at\n     long-term damaging effects of the drug. Instead, he found no\n     evidence of toxicity or brain damage, and also that long-term\n     users functioned better in their community. In 1992 Brazil\n     legalised ritual use of Ayahuasca. The FDA took careful note.\n\n     Then in the early 1990s, leading lights of the US computer\n     industry began admitting that many breakthroughs in Silicon Valley\n     in the 70s and 80s had been inspired by regular psychedelic drug\n     use. Nobel Prizewinner Kary Mullis, and founding father of\n     Microsoft, Bob Wallace, reveal on camera the psychedelic influence\n     on their creativity. This anecdotal evidence raised support for\n     the psychedelic researchers. Now Strassman has received approval\n     from the FDA for research into LSD itself.\n\n     But it is a delicate moment for the new psychedelic science. Its\n     power to treat some of the worst ailments of society has now been\n     recognised. Yet fears of the excesses of the 1960s are still\n     strong. In Japan the Aum Shinrikyo cult is believed to have used\n     psychedelics to brainwash its members before the Tokyo subway gas\n     attack. Among high-school leavers, use of psychedelics is rapidly\n     increasing - and strange new drugs are appearing on thestreets.\n     The scientists and drug regulators know there is a knife-edge\n     between hope for new treatments and unleashing a whirlwind.'),(193,'2004-05-05 13:34:47','5314a6aa52b372ef5d546f9170b2347c205b1609','http://thepiratebay.se/torrent/3214358','Rise Of Nations - Thrones And Patriots-Razor1911',750836384,'<center><h1>ENDAST BIN + CUE!!!</h1></center>\n<img src=\"http://www.nforce.nl/nfos/renderer/ls-black.php?id=65135\">'),(194,'2004-05-05 14:23:14','5d9d0b1eac0c9681e96bd657de4461f10ebfb587','http://thepiratebay.se/torrent/3214361','Da Buzz-Dangerous-CDA-2004-GaYfAcE',60478327,'da buzz bara :) enjoy'),(195,'2004-05-05 15:00:15','bb01a3d4d20ff1d18512c4c5251751bb357d70e0','http://thepiratebay.se/torrent/3214368','Moonspell - Darkness And Hope',74238488,'moonspell-darkness_and_hope_(advance)-2001-vile\njävligt bra gothic metal.'),(196,'2004-05-05 15:40:37','b076e373197217cbd2b118b1ea8608e170d73750','http://thepiratebay.se/torrent/3214372','Bottom Live 2003 Divx',727756690,'Vet inte om  den har varit uppe. Men det finns väl någon som vill ha den )'),(197,'2004-05-05 19:14:07','b08f7a20e2b968c0c73519398a9fc1dc88c48ed1','http://thepiratebay.se/torrent/3214384','Jill Sobule',119650186,'Jill Sobule - Pink Pearl(320kbit) http://tinyurl.com/2lh94\n\n\nsamt låtarna\n\nBitter\nHoudinis Box\nJet Pack\nTexas\nUnderdog Victorious\nWar Correspondent\n\n\nEn schysst singer/songwriter...'),(198,'2004-05-05 22:31:11','a8cef7521e76761ec6c01fa9cc0fe373e16e2d4e','http://thepiratebay.se/torrent/3214393','I Love Disco Diamonds Vol. 29 (Italodisco)',111001185,'01_albert_one_-_for_your_love_(another_version).mp3\n02_mark_mcdean_-_italian_girl.mp3\n03_tango_-_computerized_love.mp3\n04_linda_jo_rizzo_-_ive_got_the_night.mp3\n05_peter_jacques_band_-_this_night.mp3\n06_yoh-yo_-_the_main_attraction.mp3\n07_k.b._caps_-_catch_me_now_im_falling.mp3\n08_grant_miller_-_wings_of_love.mp3\n09_mozzart_-_devils_rendez-vous.mp3\n10_paul_sharada_-_boxer.mp3\n11_martinelli_-_orient_express.mp3\n12_brian_auger_-_night_train_to