 Matthew Dekay - If I Could Fly    \n09  Pete Jackson - Sa Trincha         \n10  Timo Maas - I\'m Your DJ           \n11  21th Street - Come On Together'),(276,'2004-05-15 15:50:24','215f3863951c1178f9c1173fb83e5fa892a90d8f','http://thepiratebay.se/torrent/3215376','Donnie.Darko.2001.COMPLETE.PAL.DVDR-EFTERLYST',2147483647,'Donnie Darko (2001)\nSource......: DVD\nOutput......: DVDR *PAL*\nRls Date....: 2002-11-20\nDVD Date....: 2002-11-20\nGenre.......: Thriller\nIMDB Rating.: 8.3/10 (8,834 votes)\nBudget......: Cheap whore\nRuntime.....: 111 Min\n\nPLOT SUMMARY\nDonnie Darko is a disturbed adolescent from a\nsemi-functional upper-middle class family. \nAfter escaping from near death because he hears \nthe voice of a 6 foot tall bunny, Donnie is led \nby the bunny to create havoc that is both \ndestructive and creative. \n\nDVD FEATURES\n\nAUDIO                       \n[X] English 2.0\n\nSUBTITLES\n[X] Swedish\n[X] Danish\n[X] Finnish\n\nASPECT RATIO\n[X] 2.35:1\n\nVIDEO      \n[X] Untouched\n\nDVD EXTRAS\n[X] All included\n\nMENU\n[X] Untouched\n\n\nimdb: http://www.imdb.com/title/tt0246578/\n.nfo: http://www.swecheck.net/nfo.asp?id=780\nLite ont om dvd-r på tpb, så jag slänger upp en jag hade liggandes... den råkar dessutom vara bra: :D'),(277,'2004-05-15 17:12:29','59e34f54eaf1c723a66c157c30c99c7196c78c10','http://thepiratebay.se/torrent/3215381','Trio Toykeat - Kudos (320Kbit).rar',170351427,'Trio Toykeat: Kudos (EmArcy/ Universal)\n\n1.Etude \n2.Met By Chance \n3.Gadd A Tee? \n4.Waltz By Chance \n5.Gadd A Tee \n6.Waltz Of Michel Petrucciani \n7.Pjut \n8.Happy Hour \n9.Heartfilms \n10.Pienta Purtavaa \n11.Ab Fab 12.Ping \n13.Kartzan`S Choice \n14.10 Years\n\nFinland’s premier jazz group, the Toykeat (which means rude ones!) are one of the most eclectic piano trios I’ve ever come across. Talk about chameleons. Their music always seems to be tumbling schizophrenically between the comic, the academic and the romantic to the downright ridiculous. Each cut on ‘Kudos’, their fourth album, pays homage to a person who has inspired them in some way, their dedications ranging from Finnish authors and film directors through Sting to Victor Borge, the latter epitomizing the forced humour Toykeat doesn’t need to resort to as often as it does. They frequently overplay the melodrama too, often interpolating a subtle, beautiful lyricism or romanticism (sometimes ala Rachmaninov) to something totally knockabout or overbearingly banal: ‘Ab Fab’ sounds more like a tribute to The Keystone Cops than Jennifer Saunders.\n\nI enjoyed them most in their more subtle and intimate moments. The wistful romance of the opening of the Gismonti dedication ‘Met By Chance’ and the somehow strangely familiar ‘Waltz For Michel Petrucciani’ are delightful and affectingly poignant. Their technical prowess is never in doubt, for pianist Liro Rantala breezes energetically through the Mozart tribute ‘Etude’ from the outset, throwing in a bit of Cecil Taylor along the way and Eerik Siikasaari’s expansive and musical bass lines, heard to good effect on ‘Pienta Purtavaa, ’10 Years’ and the introduction to ‘Heartfilms (Rantala’s piano also sounds wonderful here), are delicious. And I must also praise drummer Rami Eskelinen for some un-intrusive sticks and brushes. \n\nWasn’t it Frank Zappa who once posed the question ‘does humour belong in music’? It most certainly does and Trio Toykeat’s sense of fun is undeniably irresistible, if a tad slapstick and overblown at times. They should, however, in spite of the excesses, acquire plenty of Kudos if they keep making records like this because they are a colourful outfit of immense musicality, emotional breadth and a sense of humour rare in jazz. \n\nhttp://www.birdpages.co.uk/magazine2/triotoykeatkudos.htm\n\n\nIiro Rantala\nJanuary 19, 1970\npiano\n\n\nAmong the most internationally visible Finnish jazz musicians, Iiro Rantala is second to none when it comes to unsurpassable keyboard technique and flaring showmanship. The piano player first got infected by music in the children\'s choir Cantores Minores at the age of seven. Soon afterwards he was already taking piano lessons... And the rest, as they cliché goes, is history. \n\nSIBELIUS WOULD AGREE: THE COOLEST JAZZ COMES FROM THE NORTH \nTrio Töykeät has been Finland’s best known jazz group for 15 years, and is one of Europe’s leading and unique international music groups. Established in 1988, this tightly knitted unit, manages to pack more frenetic energy into one piece of music than most of us fit into a lifetime. They have released five great albums and the new one ‘High Standards’ is just out on the Blue Note label.\n\nFor 15 years Iiro Rantala (piano), Eerik Siikasaari (bass), and Rami Eskelinen (drums) have been touring the world in 43 countries and by now have given some 2000 concerts. Their performances are of true international calibre, and across five continents critics and enthused jazz, classical and even pop audiences have been applauding them. It’s Trio Töykeät - definitely unconventional, possibly wicked, but always uncompromising.\n\nThe Trio’s musical virtuosity has attracted wide and diverse audiences around the world. After studying at the Sibelius Academy (Finland) and the Manhattan School of Music (New York), the Toykeat musicians have during the past 15 years performed widely at festivals in Finland (such as the Pori and Espoo Jazz Festivals, Kuhmo Chamber Music Festival), New York, London, Paris, Cuba, Mexico, Belgium, Australia, Estonia, Russia, Greece, Germany, Switzerland, Italy (Umbria Jazz Festival), Singapore, Thailand, China, Japan, South Korea, Indonesia, New Zealand, Spain, Canada (Montreal Jazz Festival), Sweden, and Hong Kong, Brazil, Argentina… and many more spots around the globe.\n\n\n\n\nIiro Rantala (b.1970), piano, studied at the Sibelius Academy and Oulunkylä Jazz Conservatorium in Helsinki, as well as at the Manhattan School of Music in NYC (1991-1993). The development of Iiro Rantala as a jazz thinker has been one of the most astonishing phenomena in the Finnish music world during the last six years. Winner of all the major jazz awards in Finland in recent years.Rantala is also a virtuso classical pianist and performs regularly with symphony orchestras in Finland, works like the Mozart No.23 piano concerto and Iiro’s own piano concerto was premiered in Finland in April 2003 with the Tapiola Sinfonietta.\n\nRami Eskelinen (b.1967), drums, also started his studies at the Oulunkylä Conservatorium in 1982 until he moved to the Sibelius Academy in 1988. In 1988 Rami was chosen as the best drummer at the Hoeilaart International Jazz Contest in Belgium, where the Trio also won the first prize. Rami also studied with Iiro Rantala at the Manhattan School of Music in NYC. He was awarded best drummer of the year in Finland of 1996.\n\nEerik Siikasaari (b.1957), bass, was born into a family of jazz musicians and sounds as if he imbibed the jazz tradition with his mother’s milk . He is a graduate of the Sibelius Academy and the Oulunkylä Conservatorium. By the late 1980’s Eerik had emerged at the number one choice among the bassists of his generation. In 1995 he was awarded the Georgie Jazz award of Finland, and in 1997, Finland’s bassist of the year.\n\n\n\n\n--------------------------------------------------------------------------\nReviews:\n\n“...His playing to put it mildly is virtuoso. One must perhaps go all the way back to Franz Liszt to find the same kind of virtuosity. At least there is lots of romanticism in Rantala.”\n- Kjeld Fransden, Berlingske Tidene, Copenhagen, September 1998\n\n“Pianist Iiro Rantala is a real keyboard lion. That he sees the grand piano particularly also as a toy, appears in the many jokes in compositions lie ‘Another Ragtime, ‘Unfinnish Tango’ and ‘Hömppä Humppa’.”\n- Frans van Leeuwen - NCR Handelsblad 26/9/98\n\n“Whichever genre the Finns adapt it always remains a part of the integrate Töykeät idiom......The unrestrained technique especially by Rantala sounds astonishing, but never only for show, always functional. The 3 Finns through their openess manage to reach straight into the heart.”\n- K.S., Parool, Amsterdam/Holland, September 2000\n\n“This kind of music is completely different than the average jazz lover is used to...Their style cannot be categorised and also not be imitated, so personal it is...’Something like this we have never experienced and we feel ourselves fortunate’ was the audience exclamation. With a standing ovation the audience said farewell to these sympathetic Finns. Please return!”\n- Sim Karten, Western Courant, Holland, October 2000\n\n“Iiro Rantala is a pianistic sensation who makes the strongest case I know to believe in reincarnation because his pianistic technique and musical sensitivity speak of depths which appear impossible to have been achieved in this lifetime alone....” \n- Gil Goldstein, pianist and arranger, New York City, August 1993.\n\n“When I first heard the Trio Töykeät play I was totally bowled over...knocked out. I immediately recommended them for work...and also started hiring them... then they started hiring me! Iiro Rantala is one of the best musicians I have ever known. A RARE talent!” - .-. \n- Lew Soloff, trumpetist, New York City, August 1993.\n\n“Seldom, if ever has it happened that at an international jazz festival in Finland, a Finnish jazz group turned out to be the most outstanding of all performers”.\n- Jukka Hauru, Helsingin Sanomat, Helsinki, Finland, April 1993\n\n“Trio Töykeät contains a rare accummulation of talent and sense of style unequalled in Finland. Iiro Rantala presents a load of energy which seems to be inexhaustible”.\n- Lauri Karvonen, Helsingin Sanomat, Helsinki, April 1992\n\n“..A virtually unbroken torrent of in-your-face virtuosity, leavened with a delicious sense of humour and a daring eclecticism”..”Judging by this concert you can see why these three are gaining a reputation as one of the hottest properties in the jazz world today.”\n- Tim Bridgewater, The Dominion, Wellington, New Zealand, March 1996\n\n“It is clear that after eight years together the Finnish group possesses a unity of purpose and high level of mutual understanding and qualities that enabled them to execute difficult arrangements with ease.....Iiro Rantala’s single note runs were often electrifying”.\n- Peter Jordan, Sydney Morning Herald, Australia, March 1996'),(278,'2004-05-15 17:51:00','2abe6e8cc10e7dcb784f16b9ed379beba3bf429a','http://thepiratebay.se/torrent/3215383','Alice Cooper - Brutal Planet',59219445,'bra hårdrock'),(279,'2004-05-15 19:31:26','5b3583796a8ccea3c2b003e29132a0538e77548b','http://thepiratebay.se/torrent/3215393','Vaselines - The Way Of The Vaselines',54052442,'Klassiskt skotskt band. Nirvana gjorde en cover på deras "Son of a gun".\nFormat: AAC (iTunes).'),(280,'2004-05-15 21:26:15','03887a9afd2a02776ca1d5966ebed392bef4a9ef','http://thepiratebay.se/torrent/3215401','Thelonious Monk - Monk- The Columbia Years (1962-1968), 3CD BOX',500214700,'320Kbit\n\nThe Columbia Years: 1962-1968 \nArtist  Thelonious Monk \nAlbum Title  Columbia Years: 1962-1968 \nDate of Release  Jun 19, 2001 \nAMG Rating    \nGenre  Jazz  \nTones  Ironic, Whimsical, Nocturnal, Elegant, Sophisticated, Stylish, Quirky, Happy, Confident, Witty, Joyous, Rousing, Passionate, Complex, Fun, Irreverent, Searching, Enigmatic, Elaborate \nStyles  Bop, Post-Bop, Hard Bop \nType  compilation, live, box \nProduct Purchase Click here to buy this album  \nClick here to buy posters  \n \n  \nThis aptly titled triple-disc compilation examines Thelonious Monk\'s final years as an active recording artist. The Columbia Years: 1962-1968 is a superior primer for those seeking a thorough overview of this fertile, expressive, and oft-maligned period of Monk\'s career. In addition to embracing the bright moments from Monk\'s early- to mid-\'60s studio and live releases, compilation producer Orrin Keepnews — Thelonious\' original recording producer during his formidable tenure on the Riverside label — has included several restored performances and a few previously unissued pieces as well. The Columbia Years: 1962-1968 is subdivided into "studio" and "live" performances with each musical configuration represented. These include Monk as a soloist, in a trio, a quartet, and in a big-band context. These varied settings further augment Thelonious Monk as not only an instinctual presence on the keyboard, but as a craftsman of timeless melody, harmony, and rhythmic counterpoint. "Think of One," "Blue Monk," and a solo "Don\'t Blame Me" are among the newly mined treasures exclusive to The Columbia Years: 1962-1968. As one might presume, there are no icon-shattering discoveries among the restorations or debut releases. In their stead is a resurrection of the brilliant sound lost on previous cassette and poorly mastered CD releases. Particularly notable are the live tracks with their tangible electric vibe. "Straight, No Chaser" — taken from the September 1964 Monterey Jazz Festival — draws the listener into its confidence with satisfying crispness and warmth. Likewise, "Evidence" and "Epistrophy" — taken from the soundtrack of the award-winning documentary film Straight, No Chaser — no longer sound out of phase. In fact, the contrary would be more accurate. The conclusion of Thelonious Monk\'s brilliant recording career is lovingly captured on this box set. His inventive wisdom and candid spirit shine through every note. — Lindsay Planer \n \n    1.   Monk Speaks (Monk) - :04 \n    2.   Bye-Ya (Monk) - 5:59 \n    3.   Coming on the Hudson (Monk) - 7:32 \n    4.   Rhythm-A-Ning (Monk) - 3:53 \n    5.   Think of One (Monk) - 6:04 \n    6.   Pannonica (Monk) - 6:45 \n    7.   Crepuscule With Nellie (Monk) - 2:44 \n    8.   April in Paris (Duke/Harburg) - 7:59 \n    9.   Ugly Beauty (Monk) - 10:45 \n    10.   Honeysuckle Rose (Razaf/Waller) - 7:03 \n    11.   In Walked Bud (Monk) - 6:48 \n    12.   Thelonious (Monk) - 3:10 \n    13.   Reflections (Monk) - 4:35 \n    14.   Blue Monk (Monk) - 5:17 \n    15.   \'Round Midnight (Hanighen/Monk/Williams) - 3:49 \n    16.   Dinah (Akst/Lewis/Young) - 2:28 \n    17.   Ask Me Now (Monk) - 3:42 \n    18.   Ruby, My Dear (Monk) - 4:44 \n    19.   Don\'t Blame Me (Fields/McHugh) - 5:47 \n    20.   (When It\'s) Darkness on the Delta (Livingston/Neiburg/Symes) - 5:05 \n    21.   Played Twice (Monk) - 7:32 \n    22.   I Mean You (Hawkins/Monk) - 12:46 \n    23.   Bemsha Swing (Best/Monk) - 4:26Mo \n    24.   Jackie-Ing (Monk) - 5:02 \n    25.   Nutty (Monk) - 13:52 \n    26.   Straight, No Chaser (Monk) - 11:15 \n    27.   Evidence (Monk) - 9:01 \n    28.   Epistrophy (Clarke/Monk) - 5:33 \n    29.   Well, You Needn\'t (Monk) - 9:17 \n    30.   Misterioso (Monk) - 8:22 \n    31.   Hackensack (Monk) - 8:03 \n32.Bright Mississippi (Monk) - 8:10\n\n\n\nThelonious Monk \nAKA  real name: Thelonious Sphere Monk \nBorn  Oct 10, 1917 in Rocky Mount, NC \nDied  Feb 17, 1982 in Weehawken, NJ \n \n \n  \nby Scott Yanow\n\nThe most important jazz musicians are the ones who are successful in creating their own original world of music with its own rules, logic, and surprises. Thelonious Monk, who was criticized by observers who failed to listen to his music on its own terms, suffered through a decade of neglect before he was suddenly acclaimed as a genius his music had not changed one bit in the interim. In fact, one of the more remarkable aspects of Monk\'s music was that it was fully formed by 1947 and he saw no need to alter his playing or compositional style in the slightest during the next 25 years. \nThelonious Monk grew up in New York, started playing piano when he was around five, and had his first job touring as an accompanist to an evangelist. He was inspired by the Harlem stride pianists (James P. Johnson was a neighbor) and vestiges of that idiom can be heard in his later unaccompanied solos. However, when he was playing in the house band of Minton\'s Playhouse during 1940-1943, Monk was searching for his own individual style. Private recordings from the period find him sometimes resembling Teddy Wilson but starting to use more advanced rhythms and harmonies. He worked with Lucky Millinder a bit in 1942 and was with the Cootie Williams Orchestra briefly in 1944 (Williams recorded Monk\'s "Epistrophy" in 1942 and in 1944 was the first to record "\'Round Midnight"), but it was when he became Coleman Hawkins\' regular pianist that Monk was initially noticed. He cut a few titles with Hawkins (his recording debut) and, although some of Hawkins\' fans complained about the eccentric pianist, the veteran tenor could sense the pianist\'s greatness. \n\nThe 1945-1954 period was very difficult for Thelonious Monk. Because he left a lot of space in his rhythmic solos and had an unusual technique, many people thought that he was an inferior pianist. His compositions were so advanced that the lazier bebop players (although not Dizzy Gillespie and Charlie Parker) assumed that he was crazy. And Thelonious Monk\'s name, appearance (he liked funny hats), and personality (an occasionally uncommunicative introvert) helped to brand him as some kind of nut. Fortunately, Alfred Lion of Blue Note believed in him and recorded Monk extensively during 1947-1948 and 1951-1952. He also recorded for Prestige during 1952-1954, had a solo set for Vogue in 1954 during a visit to Paris, and appeared on a Verve date with Bird and Diz. But work was very sporadic during this era and Monk had to struggle to make ends meet. \n\nHis fortunes slowly began to improve. In 1955, he signed with Riverside and producer Orrin Keepnews persuaded him to record an album of Duke Ellington tunes and one of standards so his music would appear to be more accessible to the average jazz fan. In 1956 came the classic Brilliant Corners album, but it was the following year when the situation permanently changed. Monk was booked into the Five Spot for a long engagement and he used a quartet that featured tenor saxophonist John Coltrane. Finally, the critics and then the jazz public recognized Thelonious Monk\'s greatness during this important gig. The fact that he was unique was a disadvantage a few years earlier when all modern jazz pianists were expected to sound like Bud Powell (who was ironically a close friend), but by 1957 the jazz public was looking for a new approach. Suddenly, Monk was a celebrity and his status would not change for the remainder of his career. In 1958, his quartet featured the tenor of Johnny Griffin (who was even more compatible than Coltrane), in 1959 he appeared with an orchestra at Town Hall (with arrangements by Hall Overton), in 1962 he signed with Columbia and two years later was on the cover of Time. A second orchestra concert in 1963 was even better than the first and Monk toured constantly throughout the 1960s with his quartet which featured the reliable tenor of Charlie Rouse. He played with the Giants of Jazz during 1971-1972, but then in 1973 suddenly retired. Monk was suffering from mental illness and, other than a few special appearances during the mid-\'70s, he lived the rest of his life in seclusion. After his death it seemed as if everyone was doing Thelonious Monk tributes. There were so many versions of "\'Round Midnight" that it was practically a pop hit! But despite the posthumous acclaim and attempts by pianists ranging from Marcus Roberts to Tommy Flanagan to recreate his style, there was no replacement for the original. \n\nSome of Thelonious Monk\'s songs became standards early on, most notably "\'Round Midnight," "Straight No Chaser," "52nd Street Theme," and "Blue Monk." Many of his other compositions have by now been figured out by other jazz musicians and are occasionally performed including "Ruby My Dear," "Well You Needn\'t," "Off Minor," "In Walked Bud," "Misterioso," "Epistrophy," "I Mean You," "Four in One," "Criss Cross," "Ask Me Now," "Little Rootie Tootie," "Monk\'s Dream," "Bemsha Swing," "Think of One," "Friday the 13th," "Hackensack," "Nutty," "Brilliant Corners," "Crepuscule With Nellie" (written for his strong and supportive wife), "Evidence," and "Rhythm-a-Ning," Virtually all of Monk\'s recordings (for Blue Note, Prestige, Vogue, Riverside, Columbia, and Black Lion) have been reissued and among his sidemen through the years were Idrees Sulieman, Art Blakey, Milt Jackson, Lou Donaldson, Lucky Thompson, Max Roach, Julius Watkins, Sonny Rollins, Clark Terry, Gerry Mulligan, John Coltrane, Wilbur Ware, Shadow Wilson, Johnny Griffin, Donald Byrd, Phil Woods, Thad Jones, and Charlie Rouse. His son Thelonious Monk Jr. (T.S. Monk) has helped keep the hard bop tradition alive with his quintet and has headed the Thelonious Monk Institute, whose yearly competitions succeed in publicizing talented young players.'),(281,'2004-05-16 01:26:59','83278044f51850945b9e7a5d4dc5c6bd8a80c45a','http://thepiratebay.se/torrent/3215419','HippHipp DVD3 (Extramaterialet)',2147483647,'Jag hjälper härmed X2X med den tunga bördan av att seeda allt själv för denna underbara serien.\nHär kommer alltså extramaterialet för Hipp Hipp (DVD#3)\nCover är inkluderat i RAR-filerna. (300 dpi)\n\nOBS! Även jag har bara 512 kbit/s... så ha tålamod :)'),(282,'2004-05-16 04:33:36','9c1adb07ca215638d7dc4c703ad38507152172c1','http://thepiratebay.se/torrent/3215422','Yojimbo - Livvakten',742988103,'IMDB: http://www.imdb.com/title/tt0055630/'),(283,'2004-05-16 07:35:10','0d2755479108913fb5ee26a7b439176ab4e956dc','http://thepiratebay.se/torrent/3215426','True.Romance.1CD.1993.Soundtrack.[WmC-PL]',83682268,'Codec................: LAME 3.90\nVersion..............: MPEG 1 Layer III\nQuality..............: Extreme, (avg. bitrate: 237kbps)\nChannels.............: Joint Stereo / 44100 hz\n\nPosted by............: WmC-PL on 2004-05-02\n\nIncluded.............: NFO, M3U\n\n\n-------------------------------------------------------------------\n                       