 Theme (Hammer) - 2:26 \n   \nCD2\n   21.    Candy (Hammer) - 3:05 \n   22.    Voodoo Dance (Hammer) - 3:49 \n   23.    Lombard Trial (Hammer) - 2:36 \n   24.    Boat Party (Hammer) - 3:08 \n   25.    Angelina Flashback (Hammer) - 3:27 \n   26.    Rain (Hammer) - 2:35 \n   27.    Clues (Hammer) - 3:54 \n   28.    Crockett\'s Return (Hammer) - 3:25 \n   29.    Shadow in the Dark (Hammer) - 3:09 \n   30.    Incoming (Hammer) - 2:09 \n   31.    The Talk (Hammer) - 5:13 \n   32.    Gina (Hammer) - 3:03 \n   33.    Stone\'s War (Hammer) - 2:54 \n   34.    El Viejo Mix (Hammer) - 3:07 \n   35.    Airport Swap (Hammer) - 2:22 \n   36.    Russian Story (Hammer) - 4:14 \n   37.    Cool Runnin\' (Hammer) - 2:37 \n   38.    Texas Ranger (Hammer) - 2:23 \n   39.    The Great Boat Race (Hammer) - 2:53 \n   40.    Golden Triangle (Hammer) - 2:48 \n   41.    Runaround (Hammer) - 3:24 \n42.Turning Point (Hammer) - 1:25\n\n\nJan Hammer:\nJan Hammer is a product of diverse locales.  Born in Prague, Czechoslovakia, he began his musical journey at the age of four as a piano prodigy at thirteen he formed a jazz trio and as a young man came to the United States to attend The Berklee School of Music in Boston. In New York City, Hammer helped define a new standard for rock and jazz-fusion as a member of the Mahavishnu Orchestra and later, from his studio in suburban New York, established himself as a pioneer on many fronts through a series of inspired solo efforts and collaborations with a who’s who of contemporary musicians. It is not unexpected then, that Miami, a city half way around the world from where Hammer began, would play such a huge part in his legendary career. \nIn 1984, Hammer was approached by producers of a soon to be released television pilot set in Miami and centering around two vice detectives. True to his personality, Hammer set out to create the score for these shows in his own ingenious way.  He approached each show as its own one-hour film, and strove to stay away from the standard of “scoring by numbers” that was so prevalent in the industry. Never reading a script, Jan’s inspiration came when he first viewed the final cut, taking notes as he watched the cassettes sent from the west coast.  From a distance of 3000 miles, he re-invented the art of scoring for television.  Like Hammer himself, Miami Vice was a product of different locales: the shows were shot on location in Miami, posted in Los Angeles, and scored in New York.  Miami Vice and Jan Hammer were a perfect fit. \n\nIn a dizzying 4 to 5 day turnaround, he wrote and performed approximately 20 minutes of new music for each episode. Hammer became the show’s third star--- his music its own character with its own dialogue.  So integral was his contribution that, in the beginning, it seemed as though publicity focused mainly on the show’s two stars, Don Johnson, Philip Michael Thomas, and around Jan Hammer.  It is obvious that Universal and NBC knew what a valuable asset Hammer and his music were to the show, and the city of Miami soon knew what a valuable asset Miami Vice was---tourism increased 10% in the months following the show\'s debut. \n\nIn November 1985, Miami Vice hit number one on the Billboard Top Pop album  charts---Henry Mancini’s Music From Peter Gunn, 26 years earlier, had been the last television soundtrack to do so.  The following week “Miami Vice Theme” hit number one on the Billboard Hot 100 Singles chart and, in so doing, became the first and only instrumental theme for television to reach this pinnacle of success.  The album sold over 4 million copies domestically, over 7 million worldwide, and secured the number one position for 12 weeks.  The follow-up, Miami Vice II, also enjoyed chart-topping international success with Hammer’s hit single “Crockett’s Theme”.  At the 1986 Grammy Awards, “Miami Vice Theme” won Hammer two awards: “Best Pop Instrumental Performance” and “ Best Instrumental Composition”.  Jan Hammer’s work on “Miami Vice”, the television show and its album, had warranted and received accolades from the public, his peers and industry critics alike. \n\nOver the three and a half seasons he scored the series, Jan Hammer created an enormous body of original music from rock to reggae, from classical to jazz, and his own brand of cutting edge music.  Yet while his overwhelming commercial success, his contribution to the Miami Vice phenomenon and its lasting imprint on the industry are indisputable, Hammer might never have dreamed of producing this definitive collection of his work were it not for the volume of fan requests which come his way even today via his web site.  Says Hammer,  “ Fans would make reference to themes that I had forgotten about after all of these years, so I went back, watched the shows for myself and realized how much music there was that cried out to be released ”. \n\nIn summing up Jan Hammer’s gift and his contribution to the Miami Vice series, co-star Philip Michael Thomas once said, “If there is a soundtrack to life, Jan Hammer is the only one who can hear it”.  His diverse and unique background, his life experiences and his visionary ideas allowed him to paint with musical notes the soundtrack of a television landmark.\n\n\nMore info:\n\nhttp://www.allmusic.com/cg/amg.dll?p=amg&ampuid=UIDSUB040401061323242365&ampsql=Acce997yskrrt\n\n\nhttp://www.amazon.com/exec/obidos/tg/detail/-/B00005YORR/ref=cm_cr_dp_2_1/002-5268840-4737634?v=glance&amps=music&ampvi=customer-reviews&ampme=ATVPDKIKX0DER'),(633,'2004-06-12 21:57:05','44e474d17a11d89d33cfc541bce9433b2c52447b','http://thepiratebay.se/torrent/3218966','Banned.Anal.Edition.DVDRip-NovaVCD',1389937666,'rb'),(634,'2004-06-12 21:59:27','091b8e6f0f6d40241b884b04e249bfa4b717e5f6','http://thepiratebay.se/torrent/3218972','Lovesexy.XXX.DVDRip.XViD-CRYMXXX',747031743,'rb'),(635,'2004-06-12 23:42:23','4143b836b99704578d9a0a1e7cd4753bb8ab47eb','http://thepiratebay.se/torrent/3219010','05.29.04.SONY.VEGAS.PLUS.DVD.PRODUCTION.SUITE.V5.0-TDA