em Professor erst einmal Spott anhören.\nSchon bald wird aus der Kuriosität jedoch blutiger Ernst: Hinter Steffen sind auf einmal Killer und Handlanger her. Teils gehören sie zum Lukanier-Orden, einer Organisation, die aus der Inquisition des Vatikans hervorgegangen ist. Teils handeln sie im Auftrag des amerikanischen Industriellen John Kaun. Und sie glauben, dass Steffen von der Ausgrabungsstätte einen Brief des Toten mitgenommen hat. Das aber ist gar nicht der Fall. Um die Verfolger wieder loszuwerden, beschließt Steffen, die Kamera selbst zu finden, und das Geheimnis, dass die Killer offenbar schützen wollen, publik zu machen. \nZunächst muss er bei der israelischen Kommilitonin Sharon untertauchen. Mit ihr und ihrem Freund Yehoshua findet Steffen bald mehr heraus. Die Suche nach der Kamera führt zu einem Versteck in der Klagemauer. Und noch etwas gelingt dem Trio: John Kaun gerät in ihre Gewalt und packt aus. Seine Firma arbeitet an der Zeitmaschine, mit der der Tote in der nahen Zukunft zurück in die Zeit des Heilands reisen wird. Noch will er dies vor der Welt verbergen. Der Vatikan dagegen hat Angst davor, dass sich die Dinge in der Zeit Jesu nicht so abgespielt haben, wie sie in der Bibel stehen. Deshalb will er das Bekanntwerden des Videos verhindern. Steffens Professor und ein amerikanischer Student müssen dran glauben. Auch das Trio gerät in Gefahr. Am Ende hält Steffen den unglaublichen Fund in der Hand. Doch was er zu sehen bekommt, betrifft letztlich nicht die Kirche sondern ihn ganz persönlich ..'),(656,'2004-06-14 12:01:18','faace10b4198ef730fc42038ee098cb6889e5a04','http://thepiratebay.se/torrent/3219201','Resident.Evil.1CD.2002.Soundtrack.[WmC]',104647177,'-------------------------------------------------------------------\n                   Resident Evil OST\n-------------------------------------------------------------------\n\nAlbum................: Resident Evil OST\nYear.................: 2002\nCodec................: LAME 3.91\nVersion.......